import React from 'react';
import './App.css';

export default function Header() {
    return (
        <div className="header">
            <div className="header-lft">
                <img src="./img/GitHub-Mark-Light-32px.png" alt=""/>
                <input type="text" name="search" id="search" placeholder="Search or jump toâ€¦"/>
                <img src="https://github.githubassets.com/images/search-key-slash.svg" alt="" class="mr-2 header-search-key-slash" />
                <span className="header-navtxt">Pull requests</span>
                <span className="header-navtxt">Issues</span>
                <span className="header-navtxt">Marketplace</span>
                <span className="header-navtxt">Explore</span>
            </div>
        </div>
    )
}
